<style>
html, body {
  height: 100%;
  margin: 0px;
  padding: 0px;
}

body
{
margin: 0;
	padding: 0;
	-webkit-background-size: cover;
background-size: cover;
	background: no-repeat;
	font-family: sans-serif;
	background-position: center center;
	max-width: 100%;
	height: auto;
    width: auto\9; /* ie8 */

    
}


#main
{

	position: absolute;
	top: 50%;
	left: 50%;
	transform: translate(-50%,-50%);
	width: 400px;
	height: 380px;
	box-sizing: border-box;
	background-color: #fafafa;
	border-radius: 7px 7px 7px 7px;
	
	
}

.loginBox
{
	position: absolute;
	top: 50%;
	left: 50%;
	transform: translate(-50%,-50%);
	width: 400px;
	height: 380px;
	padding: 60px 40px;
	box-sizing: border-box;
	//background: rgba(0,0,0,.5);
	border-radius: 7px 7px 7px 7px;
	//background-color: white;
	box-shadow: 0 10px 10px black;
	border-width: thick;
	border-color: black;
	
}

.user
{
	
	overflow: hidden;
	position: absolute;
	width: 404px;
	margin-left: -2px;
	height: 35px;
	border-radius: 7px 7px 0 0;
	box-shadow: 0px 2px 5px grey;
	
	
}
h2
{
	margin: 0;
	padding: 0 0 20px;
	color: #efed40;
	text-align: center;
}
.loginBox p
{
	margin: 0;
	padding: 0;
	font-weight: bold;
	color: #fff;
}



.loginBox input
{
	width: 100%;
	margin-bottom: 15px;
	
}
#p{margin: 30px 0 -45px 0; color: grey}
#e{margin: 22px 0 -40px 0; color: grey}

input::placeholder {color: #005155;}

.loginBox input[type="text"],
.loginBox input[type="password"]
{
	
	//border-bottom: 1px solid #000;
	//border-right: 1px solid #brown;
	border-style: solid;
  border-width: 1px;
	border-image: linear-gradient(45deg, #ababab, #ababab, #ababab, #ababab, #545454, #545454, #545454, #545454) 1;
	background: transparent;
	//background:linear-gradient(360deg, #debbbb, #b9b9b9);
	border-top: none !important;
	border-left: none !important;
	outline: none;
	height: 35px;
	color: #626262;
	font-size: 16px;
	text-align:center;
	padding: 0px 3px 0px 30px;
}
::placeholder
{
	color: rgba(255,255,255,.5);
}
.loginBox input[type="submit"]
{
	border: none;
	outline: none;
	height: 40px;
	color: #fff;
	font-size: 16px;
	//background: #00c911;
	background: linear-gradient(90deg, #03a5ca, #03a5ca, #03a5ca, #03a5ca, #0299bb, #008baa, #00718a, #00677e);
	cursor: pointer;
	margin-top: 15px;

}
.loginBox input[type="submit"]:active:
{
	background: linear-gradient(90deg, #00677e, #00718a, #0299bb, #03a5ca, #03a5ca, #0299bb, #00718a, #00677e);
	color: #ffffff;
	
}
.loginBox input[type="submit"]:hover
{
	background: linear-gradient(90deg, #00677e, #00718a, #0299bb, #03a5ca, #03a5ca, #0299bb, #00718a, #00677e);
	color: #ffffff;
	
}
.loginBox input[type="submit"]:focus
{
	background: linear-gradient(90deg, #00677e, #00718a, #0299bb, #03a5ca, #03a5ca, #0299bb, #00718a, #00677e);
	color: #ffffff;
	
}

.loginBox a
{
	color: #fff;
	font-size: 14px;
	font-weight: bold;
	text-decoration: none;
}

#wrong{
	text-align: center;
	color: red;
	font-size: 12px;
	margin-top: -2px;
	margin-bottom: 20px;
}

#em{
	background: transparent;
	cursor:no-drop;
-webkit-touch-callout: none;
-webkit-user-select: none;
-khtml-user-select: none;
-moz-user-select: none;
-ms-user-select: none;
-o-user-select: none;
user-select: none;
//margin-top: 30px; 
margin-bottom: -10px; 
width: 100%;
text-align: center;
padding: 0px 3px 0px 30px;

}

#ext{

border-color: #dadada;
cursor:no-drop;
margin-top:-20px;
width: 50%;
height: 24px;
text-align: left;
font-size: 18px;
padding: 3px 3px 27px 3px;
background-color: #dadada;
border-radius: 5px 5px 5px 5px;
color: black;
}

#ico{
margin-top: 25px;
height: 25px;
width: 25px;
}

#img{
margin-top: 25px;
height: 25px;
width: 25px;
}

#load{
	position: absolute;
	top: 9.3%;
	left: 0%;
	width: 400px;
	height: 345px;
	border-radius: 0px 0px 7px 7px;
	background-color: white;
	background-color:rgba(255,255,255,0.8);
	//background-blend-mode: darken;
	//margin: 0px 30px 0px -300px;
	//padding: 0px -30% 0px 30%;
	//padding-right: -500%;
	
	
}


.iprogress{
    
    height: 40px;
    width: 80%;
    border: none;
	padding: 140px 0px 0px 45px;
    
}
.iprogress .color{
    
    background: linear-gradient(90deg, #d8e7e4, #b8d3cd, #8eb5ad, #619389, #4b8277, #336a5f, #215a4f, #0a3d33);
    width: 0px;
    height: 40px;
    animation: progres 11s infinite linear;    
}
@keyframes progres{
    0%{
      width: 0%;
    }

		
    100%{
        width: 100%;
    }
};
</style>
